cb4ea5b762c0f7ddd6965431bef04e9b6dd0bddf.source:
query LogInEmail($email: EmailAddress!, $password: String!) {
  logInEmail(email: $email, password: $password) {
    __typename
    ...LoginResponse
  }
}
fragment LoginResponse on AuthenticationResponse {
  __typename
  queryResponse {
    __typename
    ...QueryResponse
  }
  token
  user {
    __typename
    ...UserDetails
  }
}
fragment QueryResponse on QueryResponse {
  __typename
  code
  message
  success
}
fragment UserDetails on User {
  __typename
  id
  username
  prefix
  givenName
  middleName
  lastName
  role
  pictures
}

