mutation Register($user: UserRegisterationInput!) {
  register(user: $user) {
    __typename
    queryResponse {
      __typename
      ...QueryResponse
    }
    token
    user {
      __typename
      ...UserDetails
    }
  }
}
fragment QueryResponse on QueryResponse {
  __typename
  code
  message
  success
}
